var fileJSON=[{"path":"/scratch/pc2-mitarbeiter/mariusme/synth2/fnet/src/device/communication_bw520n.cl", "name":"communication_bw520n.cl", "has_active_debug_locs":false, "absName":"/scratch/pc2-mitarbeiter/mariusme/synth2/fnet/src/device/communication_bw520n.cl", "content":"/*\012Copyright (c) 2019 Marius Meyer\012\012Permission is hereby granted, free of charge, to any person obtaining a copy of\012this software and associated documentation files (the \"Software\"), to deal in\012the Software without restriction, including without limitation the rights to\012use, copy, modify, merge, publish, distribute, sublicense, and/or sell copies\012of the Software, and to permit persons to whom the Software is furnished to do\012so, subject to the following conditions:\012\012The above copyright notice and this permission notice shall be included in all\012copies or substantial portions of the Software.\012\012THE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\012IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\012FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\012AUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\012LIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\012OUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE\012SOFTWARE.\012*/\012\012/**\012 * This file contains two kernels \"send\" and \"recv\".\012 * They are identical in their function except two differences:\012 * - they use different channels for sending and receiving data\012 * - \"send\" sends first a message and then receives,  \"recv\" does it the other way around\012 *\012 * The kernels are hardcoded to work with the Bittware 520N board that offers\012 * 4 external channels.\012 * The file might need to be adapted for the use with other boards!\012 */\012\012\012#include \"parameters.h\"\012\012#pragma OPENCL EXTENSION cl_intel_channels : enable\012\012#define ITEMS_PER_CHANNEL (CHANNEL_WIDTH / sizeof(DEVICE_DATA_TYPE))\012\012/**\012 * Data type used for the channels\012 * Consider using vector types instead\012 */\012typedef struct {\012    DEVICE_DATA_TYPE values[ITEMS_PER_CHANNEL];\012} message_part;\012\012/**\012 * Definition of the external channels\012 */\012channel message_part ch_out_1 __attribute((io(\"kernel_output_ch0\")));\012channel message_part ch_out_2  __attribute((io(\"kernel_output_ch2\")));\012channel message_part ch_in_1 __attribute((io(\"kernel_input_ch0\")));\012channel message_part ch_in_2  __attribute((io(\"kernel_input_ch2\")));\012\012channel message_part ch_out_3 __attribute((io(\"kernel_output_ch1\")));\012channel message_part ch_out_4  __attribute((io(\"kernel_output_ch3\")));\012channel message_part ch_in_3 __attribute((io(\"kernel_input_ch1\")));\012channel message_part ch_in_4  __attribute((io(\"kernel_input_ch3\")));\012\012\012/**\012 * Send kernel that will send messages through channel 1 and 2 and receive messages from\012 * channel 1 and 2 in parallel.\012 *\012 * @param data_size Size of the used message\012 * @param repetitions Number of times the message will be sent and received\012 */\012__kernel\012__attribute__ ((max_global_work_dim(0)))\012void send(const unsigned data_size,\012        const unsigned repetitions) {\012    const unsigned send_iterations = (data_size +  2 * ITEMS_PER_CHANNEL - 1) / (2 * ITEMS_PER_CHANNEL);\012    message_part send_part1;\012    message_part send_part2;\012    __attribute__((opencl_unroll_hint(ITEMS_PER_CHANNEL)))\012    for (DEVICE_DATA_TYPE d = 0; d < ITEMS_PER_CHANNEL; d++) {\012        send_part1.values[d] = data_size & 255;\012        send_part2.values[d] = data_size & 255;\012    }\012    for (unsigned i=0; i < repetitions; i++) {\012        for (unsigned k=0; k < send_iterations; k++) {\012            write_channel_intel(ch_out_1, send_part1);\012            write_channel_intel(ch_out_2, send_part2);\012        }\012        message_part recv_part1;\012        message_part recv_part2;\012        for (unsigned k=0; k < send_iterations; k++) {\012            recv_part1 = read_channel_intel(ch_in_1);\012            recv_part2 = read_channel_intel(ch_in_2);\012        }\012        __attribute__((opencl_unroll_hint(ITEMS_PER_CHANNEL)))\012        for (DEVICE_DATA_TYPE d = 0; d < ITEMS_PER_CHANNEL; d++) {\012            send_part1.values[d] = recv_part1.values[d];\012            send_part2.values[d] = recv_part2.values[d];\012        }\012    }\012}\012\012\012/**\012 * Receive kernel that will send messages through channel 3 and 4 and receive messages from\012 * channel 3 and 4 in parallel.\012 *\012 * @param data_size Size of the used message\012 * @param repetitions Number of times the message will be sent and received\012 */\012__kernel\012__attribute__ ((max_global_work_dim(0)))\012void recv(const unsigned data_size,\012          const unsigned repetitions) {\012    const unsigned send_iterations = (data_size +  2 * ITEMS_PER_CHANNEL - 1) / (2 * ITEMS_PER_CHANNEL);\012    message_part send_part1;\012    message_part send_part2;\012    message_part recv_part1;\012    message_part recv_part2;\012    __attribute__((opencl_unroll_hint(ITEMS_PER_CHANNEL)))\012    for (DEVICE_DATA_TYPE d = 0; d < ITEMS_PER_CHANNEL; d++) {\012        send_part1.values[d] = data_size & 255;\012        send_part2.values[d] = data_size & 255;\012    }\012    for (unsigned i=0; i < repetitions; i++) {\012        for (unsigned k=0; k < send_iterations; k++) {\012            recv_part1 = read_channel_intel(ch_in_3);\012            recv_part2 = read_channel_intel(ch_in_4);\012        }\012        for (unsigned k=0; k < send_iterations; k++) {\012            write_channel_intel(ch_out_3, send_part1);\012            write_channel_intel(ch_out_4, send_part2);\012        }\012        __attribute__((opencl_unroll_hint(ITEMS_PER_CHANNEL)))\012        for (DEVICE_DATA_TYPE d = 0; d < ITEMS_PER_CHANNEL; d++) {\012            send_part1.values[d] = recv_part1.values[d];\012            send_part2.values[d] = recv_part2.values[d];\012        }\012    }\012}\012"}, {"path":"/scratch/pc2-mitarbeiter/mariusme/synth2/fnet/cmake-build/src/common/parameters.h", "name":"parameters.h", "has_active_debug_locs":false, "absName":"/scratch/pc2-mitarbeiter/mariusme/synth2/fnet/cmake-build/src/common/parameters.h", "content":"#ifndef SRC_COMMON_PARAMETERS_H_\012#define SRC_COMMON_PARAMETERS_H_\012\012#define VERSION \"1.1\"\012#define SEND_KERNEL_NAME \"send\"\012#define RECV_KERNEL_NAME \"recv\"\012#define DEFAULT_REPETITIONS 10\012#define DEFAULT_PLATFORM -1\012#define DEFAULT_DEVICE -1\012\012/**\012 * Kernel Parameters\012 */\012#define CHANNEL_WIDTH 32\012\012#define HOST_DATA_TYPE cl_uchar\012#define DEVICE_DATA_TYPE uchar\012\012/**\012Output separator\012*/\012#define HLINE \"-------------------------------------------------------------\\n\"\012\012#endif // SRC_COMMON_PARAMETERS_H_\012"}];
